import React, {Component} from 'react';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: '',
      body: ''
    }
  }

  render() {
    return (
      <div>
        <h1>Home</h1>
        <div>Title: <input /></div>
        <br/>
        <textarea />
      </div>
    )
  }
}

export default Home;
